let state = {
    profile: {

        messages: [
            { id: 1, message: 'Hi' },
            { id: 2, message: 'Hi' },
            { id: 3, message: 'you are good' },
            { id: 4, message: 'yo' },
            { id: 5, message: 'you' }
        ]
    },
    messagesPege: {
        dialogsData: [
            { id: 1, name: 'Aleksey' },
            { id: 2, name: 'Dmitiy' },
            { id: 3, name: 'Grigorii' },
            { id: 4, name: 'Eugeny' },
            { id: 5, name: 'Artem' }
        ],
        postData: [
            { id: 1, post: 'Hi, how are you?', likeCount: 5 },
            { id: 2, post: "It's my first post", likeCount: 8 },
            { id: 3, post: 'you are good' },
            { id: 4, message: 'yo' },
            { id: 5, message: 'you' }
        ]
    }
}
export let addPost = (postMessage) => {
    let newPost = {
        id: 5,
        message: postMessage,
        likeCount: 0
    };

    state.profile.message.push(newPost);
}
export default state
